import React from "react";
import "./styles.css";
import About from "./pages/About";
import Categorical from "./pages/Categorical";
import GenderCrimes from "./pages/GenderCrimes";
import GenderCrimesVsNonGenderCrimes from "./pages/GenderCrimes";
import IncomeRelatedVariables from "./pages/IncomeRelatedVariables";
import VizNavigation from "./components/VizNavigation";
import TimeSeries from "./pages/TimeSeries";
import DatasetOverview from "./pages/DatasetOverview";
import Spatial from "./pages/Spatial";
import ExamplePage from "./pages/ExamplePage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import './App.scss';
/*
Content across website:
    -  Navigation Bar (VizNavigation)
    -  Links to Pages Related to Specific Variables
    -  Footer (TBD)
*/
export default function App() {
  return (
    <Router>
      <div className="App">
        <VizNavigation />
        <Routes>
          <Route path="/" exact component={About} />
          <Route path="/arrests" component={Categorical} />
          <Route path="/gender-violence" component={GenderCrimes} />
          <Route path="/gender-crime-against-crime-overall" component={GenderCrimesVsNonGenderCrimes} />
          <Route path="/income-and-crime-rates" component={IncomeRelatedVariables} />
          <Route path="/crime-rates-over-time" component={TimeSeries} />
          <Route path="/about-the-data" component={DatasetOverview} />
          <Route path="/crime-rates-by-zipcode-last-year" component={Spatial} />
          <Route path="/crime-rates-by-zipcode-last-month" component={Spatial} />
          <Route path="/crime-rates-by-zipcode-over-time" component={Spatial} />
          <Route path="/example" component={ExamplePage} />

        </Routes>
      </div>
    </Router>
  );
}
